import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import ButtonGroup from 'react-bootstrap/ButtonGroup'
import Button from 'react-bootstrap/Button'
import ToggleButtonGroup from 'react-bootstrap/ToggleButtonGroup'
import ToggleButton from 'react-bootstrap/ToggleButton'

function App() {
  return (
    <div className="App">
      <link
        rel="stylesheet"
        href="https://maxcdn.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
        integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T"
        crossorigin="anonymous"
      />

      <Top />
    </div>
  );
}

function pageController() {




}

class Top extends React.Component {
  render() {
    return (
      <Container>
        <div className="Header">
          <h1 className="logo">
            Mocker
          </h1>

          <ButtonGroup aria-label="Basic example" size="lg" className="btnGrp">
            <Button>About</Button>
            <Button>Share</Button>
            <Button active>Create</Button>
            <Button>Load</Button>
            <Button>Donate</Button>
          </ButtonGroup>

          <ToggleButtonGroup type="radio" name="pages" size="lg" className="btnGrp">
            <ToggleButton>Option 1</ToggleButton>
            <ToggleButton>Option 2</ToggleButton>
            <ToggleButton>Option 3</ToggleButton>
          </ToggleButtonGroup>



        </div>
      </Container>
    );
  }
}


export default App;
